('INTER', 'THƯ PHỎNG VẤN', '<p style=\"text-align: center;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><strong><span style=\"font-size: x-large;\">THƯ PHỎNG V&Acirc;́N<br /></span></strong></span></p>\r\n<p style=\"text-align: center;\">***</p>\r\n<p style=\"text-align: left; padding-left: 30px;\"><strong>@#01</strong></p>\r\n<p style=\"text-align: left; padding-left: 30px;\">Địa chỉ: @#02</p>\r\n<p style=\"text-align: left; padding-left: 30px;\">Đi&ecirc;̣n thoại:@#03 Fax: @#04</p>\r\n<p style=\"text-align: left; padding-left: 30px;\">Email:@#05</p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<hr />\r\n<p style=\"text-align: left; padding-left: 30px;\">Người trúng tuy&ecirc;̉n: @#06</p>\r\n<p style=\"text-align: left; padding-left: 30px;\">Địa chỉ: @#07</p>\r\n<p style=\"text-align: left; padding-left: 30px;\">Đi&ecirc;̣n thoại: @#08</p>\r\n<p style=\"text-align: left; padding-left: 30px;\">Email: @#09</p>\r\n<p style=\"text-align: left; padding-left: 30px;\">&nbsp;</p>\r\n<hr />\r\n<p>&nbsp;</p>\r\n<p><strong><span style=\"text-decoration: underline;\">Y&ecirc;u cầu đối với ứng vi&ecirc;n dự tuy&ecirc;̉n:</span></strong></p>\r\n<p><strong>1. &nbsp; Vi trí tuy&ecirc;̉n dụng:</strong></p>\r\n<p><span style=\"font-family: arial,helvetica,sans-serif;\"><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; + M</strong></span>&atilde; tuyển dụng:&nbsp;<span style=\"font-family: arial,helvetica,sans-serif;\"><strong> </strong></span><strong><span style=\"font-family: arial,helvetica,sans-serif;\">@#20</span></strong></p>\r\n<p><span style=\"font-family: arial,helvetica,sans-serif;\"><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; + Ch</strong></span>ủ đề tuyển dụng:&nbsp;<span style=\"font-family: arial,helvetica,sans-serif;\"><strong> </strong></span><strong><span style=\"font-family: arial,helvetica,sans-serif;\">@#21</span></strong></p>\r\n<p><strong>2.&nbsp;&nbsp;&nbsp; </strong><strong>Ho&agrave;n thiện Hồ sơ:</strong></p>\r\n<p><strong>&nbsp;&nbsp;&nbsp;&n